import styled from 'styled-components';

export const Container = styled.div`
  height: 1000px;
  overflow: hidden;
`;

export const CrookedBG = styled.div`
  height: 800px;
  width: 100%;
  background: #c4c4c4;
  transform: scale(1) rotate(-4deg) translateX(-1px) translateY(61px)
    skewX(-4deg) skewY(0deg);
`;
